MongoDB $or operator for multiple fields separately<p>Looks like MongoDB supports $or operator only in the query root, and not per field query. So this doesn't work:</p>
<pre><code>db.collection.find({
    foo: {
        $or: [ fooQuery1, fooQuery2 ]
    },
    bar: {
        $or: [ barQuery1, barQuery2 ]
    }
})
</code></pre>
<p>so we have to write it like:</p>
<pre><code>db.collection.find({
    $or: [
        { foo: fooQuery1, bar: barQuery1 },
        { foo: fooQuery1, bar: barQuery2 },
        { foo: fooQuery2, bar: barQuery1 },
        { foo: fooQuery1, bar: barQuery2 },
    ]
})
</code></pre>
<p>Basically write all possible combinations for <code>foo</code> and  <code>bar</code>. But this is insane when we have to query by &gt;2 fields with &gt;2 OR-statements each.</p>
<p>It is quite easy to write a function which takes the fields and its OR statements from the first example and to generate all possible variations from the second example. But is there some MongoDB native approach, may be we are missing here something.</p>
<p>And may be you know the reason, why the first approach is not supported? So that we better understand mongodb internals.</p>
<p>Thank you.</p>

