Trouble with MongoDB C# driver when performing queries using GuidRepresentation.Standard GuidSerializer<p>I am using the MongoDB C# driver version 2.11.0. I am aware of how GUIDs were handled differently by each driver in the past, and now there is a common standard. This isn't used by default in the C# driver for backwards compatibility reasons. The current recommendation seems to be to set the GuidRepresentation on the serializer. Either globally or for each mapped Guid property individually.</p>
<p>That's all fine, the problem I am facing is that queries against collections are not honoring the serialization settings, and only work properly when using the deprecated MongoDefaults setting. Documents are properly stored using the correct GuidRepresentation, but queries seem to attempt matching CSUUID rather than UUID, therefore it never matches with a document in the database.</p>
<p>Here's a basic class map:</p>
<pre><code>public static void RegisterClassMaps()
{
    BsonClassMap.RegisterClassMap&lt;Widget&gt;(cm =&gt;
    {
        cm.MapIdProperty(w =&gt; w.Id)
            .SetSerializer(new GuidSerializer(GuidRepresentation.Standard));
        cm.MapProperty(w =&gt; w.ParentId)
            .SetSerializer(new GuidSerializer(GuidRepresentation.Standard));
        cm.MapProperty(w =&gt; w.Name);
    }
}
</code></pre>
<p>And here's a simple query matching a Guid and a string. The following method will always return null, as it builds the query using CSUUID rather than UUID.</p>
<pre><code>private readonly IMongoCollection&lt;Widget&gt; _collection;

public async Task&lt;Widget&gt; FindByNameAsync(Guid parentId, string name)
{
    var query = _collection.Find(w =&gt;
        w.ParentId == parentId &amp;&amp;
        w.Name = name);
    return await query.SingleOrDefaultAsync();
}
</code></pre>
<p>Using AsQueryable() rather than Find() has the same result. Both build the query using CSUUID rather than UUID.</p>
<p>I also tried setting the global GuidSerializer to use GuidRepresentation.Standard, but I got the same results.</p>
<pre><code>BsonSerializer.RegisterSerializer(new GuidSerializer(GuidRepresentation.Standard));
</code></pre>
<p>If I change the value of the deprecated MongoDefaults property, everything works perfectly fine.</p>
<pre><code>MongoDefaults.GuidRepresentation = GuidRepresantion.Standard;
</code></pre>
<p>Am I missing something on how I am constructing my queries? I would prefer to avoid the deprecated setting.</p>

